import PropTypes from 'prop-types';

const Button = ({ handleLoadMoreButton }) => {
  return (
    <button className="Button" onClick={handleLoadMoreButton} id="load-more">
      LoadMore
    </button>
  );
};

Button.propTypes = {
  handleLoadMoreButton: PropTypes.func.isRequired,
};

export default Button;
